import os
import sys

def SkewDiagram(Genome):
    Skew = []
    Skew.append(0)
    MinimumPos = []
    Min = Skew[0]
    
    for i in range (len(Genome)):
        if Genome[i] in ["A", "T"]:
            Skew.append(Skew[i])
        elif Genome[i] == 'G':
            Skew.append(Skew[i] + 1)
        else :
            Skew.append(Skew[i] - 1)
        if Skew[i+1] < Min :
            Min = Skew[i+1]
    
    for  i in range (len(Skew)):
        if  Skew[i] == Min :
            MinimumPos.append(i)
    
    return ' '.join(str(num) for num in MinimumPos)

def main():
    print(SkewDiagram(""))
main()